import React from 'react';
import '../styles/App.css';

const DealerList = ({ dealers, onEdit, onDelete }) => {
  if (!dealers || dealers.length === 0) {
    return (
      <div className="empty-state">
        <div className="empty-icon">üè¢</div>
        <h3>No dealers found</h3>
        <p>Try adding a new dealer</p>
      </div>
    );
  }

  return (
    <div className="cars-grid">
      {dealers.map((dealer) => (
        <div key={dealer.id} className="car-card">
          <div className="car-header">
            <div className="car-title">{dealer.name}</div>
            <div className="car-id">ID: {dealer.id}</div>
          </div>

          <div className="car-details">
            <div className="detail-row">
              <span className="detail-label">City:</span>
              <span className="detail-value">{dealer.city}</span>
            </div>
            <div className="detail-row">
              <span className="detail-label">Address:</span>
              <span className="detail-value">{dealer.address}</span>
            </div>
            <div className="detail-row">
              <span className="detail-label">Area:</span>
              <span className="detail-value">{dealer.area}</span>
            </div>
            <div className="detail-row">
              <span className="detail-label">Rating:</span>
              <span className="detail-value">
                {dealer.rating}/5 ‚≠ê
              </span>
            </div>
          </div>

          <div className="car-actions">
            <button 
              onClick={() => onEdit(dealer.id)} 
              className="btn btn-warning"
            >
              ‚úèÔ∏è Edit
            </button>
            <button 
              onClick={() => onDelete(dealer.id)} 
              className="btn btn-danger"
            >
              üóëÔ∏è Delete
            </button>
          </div>
        </div>
      ))}
    </div>
  );
};

export default DealerList;
